import React from 'react'
import './Square.css'

function Square({id}) {

    function changeBox (e) {
        e.target.style.background  = (e.target.style.background === 'blue') ? 'white' : 'blue';
    }

    return (
        <div id = {id} onMouseOver={changeBox}>
        </div>
    )
}

export default Square
